    false,nt"url": null,nt"notes": "In June of 2007 there was an electro-fishing
    survey done within a small lake at the Laurel Grove Tract of the Rappahannock River
    Valley National Wildlife Refuge. High catch-per-unit-of-effort values suggest medium
    to high density largemouth bass and sunfish populations. There is concern about
    adequate numbers of appropriately sized prey for consumption by growing largemouth
    bass. There was an unexpected lack of diversity recorded from initial trapping and
    electro-fishing efforts, given the proximity of the lake to Farnham Creek. This
    plan presents recommendations for practical approaches to successful public use
    of Laurel Grove Lake that discuss angler involvement, aquatic habitat enhancement,
    and additional electro-fishing surveys.",nt"license_title": "License Not Specified",nt"extras":
